import calculate
import unittest
from calendar import isleap

class TestCalculate(unittest.TestCase):

    def test_judge_leap_year(self):
        # Test if the function correctly identifies leap years
        self.assertEqual(calculate.judge_leap_year(2000), isleap(2000))
        self.assertEqual(calculate.judge_leap_year(1900), isleap(1900))
        self.assertEqual(calculate.judge_leap_year(2004), isleap(2004))
        self.assertEqual(calculate.judge_leap_year(2001), isleap(2001))

        # Test if the function correctly identifies non-leap years
        self.assertEqual(calculate.judge_leap_year(2002), isleap(2002))
        self.assertEqual(calculate.judge_leap_year(2003), isleap(2003))

